INSERT INTO `Projects` (Id,CourseId,Description,EmailTemplate,Name,Status) VALUES ('4fa991cf-5528-4665-a055-9964d97d3643','2a5c83b0-bc5e-4288-bfc1-4cae1bb8962d','Grade your teammates'' work in application exercises','Dear %%STUDENT_NAME%%,

Please grade your own and your teammates'' participation in doing application exercises with your team in the course MH3110 - Ordinary Differential Equations. The score you are giving to someone else should be proportional to his or her contribution to team''s work, i.e., the number of exercises that they actively discuss in class and type at home. Please write a few words about each teammate - mention their strengths and suggest some way how they can improve.

You have 21 points to distribute between your teammates and you are supposed to evaluate your own work, although the latter is not a part of the grading and does not contribute towards the 21 points.

Click here:
URL grademe.azurewebsites.net/sign-in
Username: %%STUDENT_USERNAME%%
Password: %%STUDENT_PASSWORD%%

This round of peer evaluation is not graded, but we will use its results to select the leader of each team.

Yours
Fedor','TBL1','Closed'),
 ('ba94babd-e335-491d-bf08-80373c4cbfb3','2a5c83b0-bc5e-4288-bfc1-4cae1bb8962d','Grade your teammates'' work in course project','Dear %%STUDENT_NAME%%,

Please grade your own and your teammates'' participation in doing project work with your team in the course MH3110 - Ordinary Differential Equations. The score you are giving to someone else should be proportional to his or her contribution to effort that is calculated as follows:

Doing research and inventing the project''s topic: 40%
Setting up the model: 20%
Preparing slides for the first presentation: 20%
Doing numerical simulation, i.e., solving your model on the computer.


You have 21 points to distribute between your teammates and you are supposed to evaluate your own work, although the latter is not a part of the grading and does not contribute towards the 21 points.

Click here:
URL grademe.azurewebsites.net/sign-in
Username: %%STUDENT_USERNAME%%
Password: %%STUDENT_PASSWORD%%

This round of peer evaluation is not graded, but it is important that you give comprehensive feedback to your teammates. Please mention there strengths and how they can improve in the following two weeks.

Yours
Fedor','Project 1','Results'),
 ('e0d42fbf-97f5-463c-b0b0-f1556255e793','03f663da-d0ac-46a2-af9e-9d081824c09a','','Dear %%STUDENT_NAME%%,
 
