The submission deadline is Thursday 13 April.','TBL evaluation','Results'),
 ('e16962e3-dd90-4c31-8110-890dd4e5b9e1','62147383-b766-4c63-b566-55f40e8c0743','Tutorial presentations and final project','Dear %%STUDENT_NAME%%,
 
Please grade your own and your teammates'' participation in working on tutorial presentations and the final project with your subgroup/team in the course GEK2005/GES1026 - Urban Planning in Singapore. The score you are giving to someone else should be proportional to his or her contribution to team''s work, i.e., the number and quality of tutorial presentations that they actively worked on with group and the work they have done for the final project. Please write a few words about each teammate - mention their strengths and suggest how they can improve.

You have 21 points to distribute between your teammates and you are supposed to evaluate your own work too, although the latter is not a part of the grading and does not contribute towards the 21 points.
 
