INSERT INTO `Evaluations` (Id,EvaluatedStudentId,EvaluatorStudentId,Grade,Justification,ProjectId,Time) VALUES ('03cc51ed-ed27-4358-ab6f-d0b95c25fec2','8ba30804-6540-4495-a14f-1206aecdeb9b','b5dd6789-ecb1-4889-9e68-ed6c4bc5132b',5,'He tries his best to come up with different types of Matlab code to make sure our codes work. Tried his best to google everything he can and even searched up the textbook to help. He also cleaned the data and changed it into a form that we needed.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-24 05:30:50.3746983'),
 ('9eb451b3-a79f-4540-881a-a9f756225fa6','450ca2ad-324d-444e-b25f-a095fccad994','b5dd6789-ecb1-4889-9e68-ed6c4bc5132b',3,'Gave constructive comments to our research questions but didn''t contribute much to the group work. Only vetted the whole report for English.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-24 05:30:50.3746983'),
 ('e1dfe67c-bf80-4a1a-b06f-86d36c452b3a','0b39f027-ef90-4183-b04a-f7d4636d713c','b5dd6789-ecb1-4889-9e68-ed6c4bc5132b',7,'The Math lab expert which did the main bulk of the Matlab codes. Without him, our function would not have ran and it will not be a successful project.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-24 05:30:50.3746983'),
