 ('8a92745d-992f-44ed-b4d5-aad6a493fc89','5e2f2bba-5ff6-46a2-8a47-f1d0442bc7ab','6ce6cafe-8cd8-4e86-af73-f9c308d9ff90',4,'Jing Wen is an avid listener during every group discussion. She often poses insightful questions that allow us to further improve the quality of our group work. For the Pokemon Go Project, she was involved in writing the summary of our report and performing data exploration.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-26 05:26:31.2648276'),
 ('06a47d39-30ab-4ca6-aba7-11d234c70791','0c76cc92-433e-4ade-861f-39cf6f7d5c9f','6ce6cafe-8cd8-4e86-af73-f9c308d9ff90',4,'Initially, Yuewen was assigned the role of Programmer for the Pokemon Go Project. She displayed her selflessness by constantly involving herself with the work of the Theorists and Authors. She also went out of her way to take on the challenging task of tackling the research questions, which required in-depth understanding of the Bayesian Network and using it to calculate conditional probabilities.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-26 05:26:31.2648276'),
 ('6856ac22-561d-46c8-8c3b-46f1c8ba2630','320ca697-901e-4c6d-ba40-f1874a200003','6ce6cafe-8cd8-4e86-af73-f9c308d9ff90',5,'Hardian had a lot of initiative. He is often the first person to start work, and then guides the rest of us along. He competently fulfilled his role as a Theorist by teaching the rest of the group about Bayesian Network and how it can be used to calculate conditional probabilities. Furthermore, he committed a great deal of time and effort in the Pokemon Go Project.','0c7c1298-388d-4b6b-8b53-68c5ac3390bd','2016-10-26 05:26:31.2648276'),
