 ('eac83793-77e3-4fae-a12b-db6c4ffd405e','05d0d0a4-4486-45d8-a412-b3e39a90c1d3','29c7d964-3812-4e0e-bd01-91519e1b617a',5,'Xiu Hui and I helped in calculating the probabilities to back our coding and we helped Yan Ni come up with the research questions. For the second project, she researched on the various algorithms we would need. She als helped writing the introduction and conclusion of the report.','e2d8727e-afab-4f0f-9f36-3316a770f5b3','2016-11-14 17:25:57.8081265'),
 ('fc61440b-74ee-4a9f-b4ae-d3abc5ab42b1','29c7d964-3812-4e0e-bd01-91519e1b617a','29c7d964-3812-4e0e-bd01-91519e1b617a',4,'To whomever is reading this, despite my circumstances, i feel that the grade i awarded myself is fair, although some of my group members may disagree. 

For the first project, I participated in group discussions and helped with the calculations for the baysian equations to support the figures produced by the matlab code. I also helped in writing parts of the report.

For the second project, I fell really sick and obtained a 2 week mc from the doctor. I was also cautioned not to go out as what i had was quite contagious. I apologised to my group for my absence and promised to try to get well enough to travel to school after one week, which is what i did. I also requested to be updated on what is going on. However, when i returned to school, my group did not want to meet up as they had already completed the project and written up the report in my absence, and i guess it was much too troublesome to give me updates on what they were working on. Hence, the only thing i could do to help was improve on the report by correcting the language. It was not my intention to "freeload", but what else could i do when correcting the language was the only thing they left for me to do, despite there being a week until the submission dateline.

Although i feel that what happened is extremely unfair to me, i have no choice but to give myself the lowest grade out of all my group members. I understand that my group mates probably wanted to finish the project as soon as possible in order to focus on other courses. Hence, i think giving myself a 4 and everyone else a 5/6 is reasonable based on how much i contributed in the first project, and everyone else contributed more than i did for the second project. If my group mates award me a higher score, then they are being generous.','e2d8727e-afab-4f0f-9f36-3316a770f5b3','2016-11-14 17:25:57.8081265'),
 ('a34e786d-f48b-4be0-b4d6-150f923c1e19','69ca0917-110f-41a7-ac15-27cb8a1888e3','29c7d964-3812-4e0e-bd01-91519e1b617a',5,'Yida helped Daphne with the coding and helped the rest of us with the calculations portion of the project. He and Yan Ni meticulously analysed the data to come up with the tables that we used in the calculations for the various conditional probabilities. He also contributed greatly in the writing of the report. For the second project, he helped in determining an the equation with the minimum least squares error.','e2d8727e-afab-4f0f-9f36-3316a770f5b3','2016-11-14 17:25:57.8081265'),
