 ('94de4bb2-abb5-4c98-9d99-ad834bb30e85','8ba30804-6540-4495-a14f-1206aecdeb9b','0b39f027-ef90-4183-b04a-f7d4636d713c',6,'De Jian took the initiative to start clean up of codes for pokemon project on 1st day of project meeting. He also took iniitiative to read up on Particle Swarm Optimisation codes and video tutorials online before our scheduled meeting. He is one of the group members who have better matlab knowledge and he made good contribution in coding.  Although sometimes the codes he suggested and tried out did not work well at the first try, he did not give up and tried to find the error and eventually managed to get the correct codes for thickening of the lines in graph of project 2. With his interest in computing and positive learning attitude, he will definitely achieve great things in the future.

