 ('8a7a9795-4170-440b-bd0f-59850e63cf00','450ca2ad-324d-444e-b25f-a095fccad994','0b39f027-ef90-4183-b04a-f7d4636d713c',3,'Although he did not learn much matlab before (Just few weeks in his university in UK) , he volunteered to help us vet through the entire report before submission, checking for the any English errors. On top of that, he tried to involve in our group discussion occasionally once he got some ideas, such as help in crafting of 3 research questions in pokemon project. Commendable effort, especially so as he have little understanding of matlab and he was an exchange student.','e2d8727e-afab-4f0f-9f36-3316a770f5b3','2016-11-15 21:09:17.9176504'),
 ('3faaea5e-3523-439b-ae4d-4e112185e8b5','0b39f027-ef90-4183-b04a-f7d4636d713c','0b39f027-ef90-4183-b04a-f7d4636d713c',6,'Firstly, thanks for the wonderful opportunity given in this module for us to explore how computing is largely applicable to what we have learnt in calculus, linear algebra, probability and statistics. This module really ties in nicely with the modules we taking this semester. Secondly, I was blessed to have a great team to work with. The dynamics for our team is really good. Our group have constructive discussion every single meeting. When someone has an idea, we all listened and try to improve on the idea. The effective discussion really facilities in our smooth progress of the whole project. Although I am one of the best in computing among my teammates, I have never ever felt that I carry the entire project. Everyone in the team took the initiative to participate in group discussion to refine our codes and refine our ideas proposed. Most importantly, the positive attitude in learning computing among my teammates was really the key in us having a very smooth going project. None of us complain that this module is time consuming. Our positive attitude really keeps us interested throughout the project. I think as a team, we really immerse ourselves into the entire learning process, and not just treat this course as just another math core module to clear. It was really great and satisfying to see all my teammates enjoyed the whole learning process and better appreciate the beauty of computing. This is really the true university learning experience and I am really glad to be part of this team to grow and nurture together.

As for what I did in the 2 projects, I contribute mainly in the coding work. I came up with the for loops to calculate and store the conditional probabilities of each nodes of the Bayesian Networks. I came up with the idea of using scaling and translation with respect to x and y axis to get our 4 parameters for curve fitting in island ecology project. I helped out in modifying the codes in PSO file to suit our project. I also did the theoretical explanation of math concepts, such as how to explain a piecewise function is continuously differentiable at different points. I tried my best to ensure that our group stays on task if we sometimes digress to other things.','e2d8727e-afab-4f0f-9f36-3316a770f5b3','2016-11-15 21:09:17.9176504'),
 ('9f8dd93d-062d-4816-b67f-d98c19f5484c','512723e3-5952-4ce9-bac1-50461e9368b0','0b39f027-ef90-4183-b04a-f7d4636d713c',6,'Wei Jie show great flexibility and perseverence many a times throughout the project. I worked with him to brainstorm how we could store complex probability tables of each node in Bayesian Network of pokemon project. Once we faced a problem and stuck for quite some time, he usually can come up with fresh ideas to work around the problem. Another time he was really trying very hard to edit the bibtex file to get it running. Eventually after thorough research he managed to solve the issue with the codes. He took the initiative the read parts of the research paper on small island effect so that we can extract useful information from it to quote to help in our explanation of small island effect in our report. His theoretical knowledge on probability and calculus also comes to help as we are trying to explain the math parts in the report. With his hardwork and perseverence, he will definitely succeed in the future.

